{"tool":"newFileCreated","path":"main.go","content":"package main

import (
	"log"
	"net/http"
	"strconv"
	"time"

	"github.com/gin-gonic/gin"
	"gorm.io/driver/sqlite"
	"gorm.io/gorm"
)

type Habit struct {
	ID              uint      `json:"id" gorm:"primaryKey"`
	Name            string    `json:"name" gorm:"not null"`
	Description     string    `json:"description"`
	WeeklyFrequency int       `json:"weekly_frequency" gorm:"not null"`
	CreatedAt       time.Time `json:"created_at"`
}

type Completion struct {
	ID             uint      `json:"id" gorm:"primaryKey"`
	HabitID        uint      `json:"habit_id" gorm:"not null"`
	CompletionDate time.Time `json:"completion_date" gorm:"not null"`
	CreatedAt      time.Time `json:"created_at"`
	Habit          Habit     `json:"habit" gorm:"foreignKey:HabitID"`
}

var db *gorm.DB

func initDatabase() {
	var err error
	db, err = gorm.Open(sqlite.Open("habits.db"), &gorm.Config{})
	if err != nil {
		log.Fatal("Failed to connect to database:", err)
	}

	// Auto-migrate the schema
	db.AutoMigrate(&Habit{}, &Completion{})
}

func main() {
	initDatabase()

	r := gin.Default()

	// Serve static files
	r.Static("/static", "./static")
	r.LoadHTMLGlob("templates/*")

	// Routes
	r.GET("/", func(c *gin.Context) {
		c.HTML(http.StatusOK, "index.html", nil)
	})

	// API routes
	api := r.Group("/api")
	{
		api.GET("/habits", getHabits)
		api.POST("/habits", createHabit)
		api.DELETE("/habits/:id", deleteHabit)
		api.POST("/habits/:id/complete", completeHabit)
		api.GET("/habits/:id/completions", getHabitCompletions)
	}

	log.Println("Server starting on :8080")
	r.Run(":8080")
}

func getHabits(c *gin.Context) {
	var habits []Habit
	db.Find(&habits)
	c.JSON(http.StatusOK, habits)
}

func createHabit(c *gin.Context) {
	var habit Habit
	if err := c.ShouldBindJSON(&habit); err != nil {
		c.JSON(http.StatusBadRequest, gin.H{"error": err.Error()})
		return
	}

	if habit.WeeklyFrequency <= 0 || habit.WeeklyFrequency > 7 {
		c.JSON(http.StatusBadRequest, gin.H{"error": "Weekly frequency must be between 1 and 7"})
		return
	}

	db.Create(&habit)
	c.JSON(http.StatusCreated, habit)
}

func deleteHabit(c *gin.Context) {
	id := c.Param("id")
	db.Delete(&Habit{}, id)
	c.JSON(http.StatusOK, gin.H{"message": "Habit deleted"})
}

func completeHabit(c *gin.Context) {
	habitID, err := strconv.Atoi(c.Param("id"))
	if err != nil {
		c.JSON(http.StatusBadRequest, gin.H{"error": "Invalid habit ID"})
		return
	}

	// Check if already completed today
	today := time.Now().Format("2006-01-02")
	var existingCompletion Completion
	result := db.Where("habit_id = ? AND DATE(completion_date) = ?", habitID, today).First(&existingCompletion)

	if result.Error == nil {
		c.JSON(http.StatusBadRequest, gin.H{"error": "Habit already completed today"})
		return
	}

	completion := Completion{
		HabitID:        uint(habitID),
		CompletionDate: time.Now(),
	}

	db.Create(&completion)
	c.JSON(http.StatusCreated, completion)
}

func getHabitCompletions(c *gin.Context) {
	habitID := c.Param("id")
	var completions []Completion
	db.Where("habit_id = ?", habitID).Order("completion_date desc").Find(&completions)
	c.JSON(http.StatusOK, completions)
}","operationIsLocatedInWorkspace":true}

