{"tool":"newFileCreated","path":"static/app.js","content":"// Global variables
let habits = [];

// DOM elements
const habitForm = document.getElementById('habitForm');
const habitsList = document.getElementById('habitsList');
const messageContainer = document.getElementById('messageContainer');

// Initialize the app
document.addEventListener('DOMContentLoaded', function() {
    loadHabits();
    setupEventListeners();
});

// Set up event listeners
function setupEventListeners() {
    habitForm.addEventListener('submit', handleAddHabit);
}

// Load habits from the API
async function loadHabits() {
    try {
        const response = await fetch('/api/habits');
        if (!response.ok) throw new Error('Failed to load habits');

        habits = await response.json();
        renderHabits();
    } catch (error) {
        showMessage('Error loading habits: ' + error.message, 'danger');
    }
}

// Render habits in the UI
function renderHabits() {
    if (habits.length === 0) {
        habitsList.innerHTML = '<div class="empty-state">No habits yet. Add your first habit above!</div>';
        return;
    }

    habitsList.innerHTML = habits.map(habit => `
        <div class="habit-item" id="habit-${habit.id}">
            <div class="habit-header">
                <h5 class="habit-name">${escapeHtml(habit.name)}</h5>
